import {
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom"

const router = createBrowserRouter([
  {
    path:"/",
    element:<span>None</span>
  },
  {
    path:"/products/:id",
    element:<span>Category</span>
  },
  {
    path:"/products/:id",
    element:<span>Product</span>
  },
])

function App() {
  return <div>
    <RouterProvider router={router}/>
  </div>;
}

export default App;
